    [],nt"revision_timestamp": "2016-11-23T04:53:43.828917",nt"name": "modflow-nwt-2016-groundwater-flow-model-for-dane-county-wisconsin",nt"isopen":
    false,nt"url": null,nt"notes": "A new groundwater flow model was created
    for Dane County, Wisconsin, to replace an earlier model developed in the 1990s by
    the Wisconsin Geological and Natural History Survey (WGNHS) and the U.S. Geological
    Survey (USGS). This modeling study was conducted cooperatively by the WGNHS, the
    Capital Area Regional Planning Commission, and the USGS. Although the overall conceptual
    model of the groundwater system remains largely unchanged, the incorporation of
    newly acquired, high-quality datasets, recent research findings, and improved modeling
    and calibration techniques have led to the development of a much more detailed and
    sophisticated model representation of the groundwater system. The new model is three-dimensional
    and transient, and conceptualizes the countyu00e2u0080u0099s hydrogeology as a 12-layer
    system including all major unlithified and bedrock hydrostratigraphic units and
    two high-conductivity horizontal fracture zones.",nt"license_title": null,nt"extras":
